import React from 'react'
import './portfolioList.css'

const PortfolioList = ({id, title, active, setSelected}) => {
  return (
  <div>
      <li className={active ? 'PortfolioList active': 'PortfolioList'}
        onClick = {() => setSelected(id)}>
      {title}
    </li>
  </div>
  
  )
} 

export default PortfolioList
